#include "metaRoleObject.h"

/* PNG */
static const wxString s_role_64_png = wxT("");

wxIcon CValueMetaObjectRole::GetIcon() const
{
	return GetIconGroup();
}

wxIcon CValueMetaObjectRole::GetIconGroup()
{
	static wxIcon icon =
		CBackendPicture::GetIconFromBase64(s_role_64_png, wxSize(16, 16));

	return icon;
}
